import{_ as e,c as a,o as i,a as r}from"./app.b2f55d8a.js";const u=JSON.parse('{"title":"SpringBoot \u901F\u901A 1\uFF1AHello, Spring Boot","titleTemplate":"Quick Start","description":"","frontmatter":{"title":"SpringBoot \u901F\u901A 1\uFF1AHello, Spring Boot","titleTemplate":"Quick Start"},"headers":[{"level":2,"title":"\u6954\u5B50","slug":"\u6954\u5B50","link":"#\u6954\u5B50","children":[]},{"level":2,"title":"Spring \u5FC5\u8981\u57FA\u7840\u77E5\u8BC6\u70B9","slug":"spring-\u5FC5\u8981\u57FA\u7840\u77E5\u8BC6\u70B9","link":"#spring-\u5FC5\u8981\u57FA\u7840\u77E5\u8BC6\u70B9","children":[{"level":3,"title":"Java Bean \u4E0E POJO \u4E0E Spring Bean","slug":"java-bean-\u4E0E-pojo-\u4E0E-spring-bean","link":"#java-bean-\u4E0E-pojo-\u4E0E-spring-bean","children":[]},{"level":3,"title":"IOC","slug":"ioc","link":"#ioc","children":[]},{"level":3,"title":"AOP","slug":"aop","link":"#aop","children":[]}]},{"level":2,"title":"\u5173\u4E8E Spring Boot","slug":"\u5173\u4E8E-spring-boot","link":"#\u5173\u4E8E-spring-boot","children":[{"level":3,"title":"\u6982\u89C8","slug":"\u6982\u89C8","link":"#\u6982\u89C8","children":[]},{"level":3,"title":"\u7279\u6027","slug":"\u7279\u6027","link":"#\u7279\u6027","children":[]},{"level":3,"title":"\u53C2\u8003","slug":"\u53C2\u8003","link":"#\u53C2\u8003","children":[]}]}],"relativePath":"notes/quick-start/spring-boot-1.md","lastUpdated":1662340773000}'),n={name:"notes/quick-start/spring-boot-1.md"},t=r('<h1 id="springboot-\u901F\u901A-1\uFF1Ahello-spring-boot" tabindex="-1">SpringBoot \u901F\u901A 1\uFF1AHello, Spring Boot <a class="header-anchor" href="#springboot-\u901F\u901A-1\uFF1Ahello-spring-boot" aria-hidden="true">#</a></h1><h2 id="\u6954\u5B50" tabindex="-1">\u6954\u5B50 <a class="header-anchor" href="#\u6954\u5B50" aria-hidden="true">#</a></h2><p>\u56E0\u4E3A\u65F6\u95F4\u4E0E\u5730\u57DF\u7684\u5173\u7CFB\uFF0C\u9676\u67D0\u4E8E 2020 \u5E74 10 \u6708 27 \u65E5\u5F00\u59CB\u7CFB\u7EDF\u5B66 SpringBoot\u3002\u7531\u4E8E\u51FA\u53D1\u70B9\u8FDC\u4E0D\u662F<strong>\u7231</strong>\uFF0C\u6545\u8FD9\u573A\u5B66\u4E60\u5C06\u65E0\u4E0E\u4F26\u6BD4\u5730\u67AF\u71E5\u3001\u8270\u8F9B\u3001\u5145\u6EE1\u77DB\u76FE\u3002\u4F46\u8D2B\u82E6\u5E03\u8863\u7684\u4EBA\u751F\u672C\u5C31\u5982\u6B64\u3002</p><p>\u201C\u4F60\u662F\u5426\u613F\u610F\u5B66\u4E60 SB\uFF0C\u65E0\u8BBA\u662F\u987A\u5883\u6216\u9006\u5883\uFF0C\u5BCC\u88D5\u6216\u8D2B\u7A77\uFF0C\u5065\u5EB7\u6216\u75BE\u75C5\uFF0C\u5FEB\u4E50\u6216\u5FE7\u6101\uFF0C\u4F60\u90FD\u5C06\u6BEB\u65E0\u4FDD\u7559\u5730\u7231\u5979\uFF0C\u5BF9\u5979\u5FE0\u8BDA\u76F4\u5230\u6C38\u8FDC\uFF1F\u201D</p><p>...</p><h2 id="spring-\u5FC5\u8981\u57FA\u7840\u77E5\u8BC6\u70B9" tabindex="-1">Spring \u5FC5\u8981\u57FA\u7840\u77E5\u8BC6\u70B9 <a class="header-anchor" href="#spring-\u5FC5\u8981\u57FA\u7840\u77E5\u8BC6\u70B9" aria-hidden="true">#</a></h2><p>\u7531\u4E8E Java \u5386\u53F2\u4E4B\u60A0\u4E45\u3001Spring \u6846\u67B6\u4E4B\u7E41\u8363\uFF0C\u4F7F\u7528 Spring Boot \u65F6\uFF0C\u4E0D\u5F97\u4E0D\u9884\u5148\u638C\u63E1\u4E00\u4E9B\u901A\u7528\u6982\u5FF5\u3002\u5305\u62EC\u4F46\u4E0D\u9650\u4E8E\uFF1A</p><h3 id="java-bean-\u4E0E-pojo-\u4E0E-spring-bean" tabindex="-1">Java Bean \u4E0E POJO \u4E0E Spring Bean <a class="header-anchor" href="#java-bean-\u4E0E-pojo-\u4E0E-spring-bean" aria-hidden="true">#</a></h3><p>Java Bean \u8BDE\u751F\u5728\u5F88\u4E45\u5F88\u4E45\u4EE5\u524D\uFF0C\u90A3\u4E2A\u684C\u9762\u5E94\u7528\u5F00\u53D1\u767E\u82B1\u9F50\u653E\u7684\u65F6\u4EE3\u3002\u5176\u51FA\u751F\u7684\u672C\u610F\u662F\uFF0C\u901A\u8FC7\u7F16\u5199<strong>\u7B26\u5408\u65E2\u5B9A\u89C4\u8303\u7684\u7C7B</strong>\uFF0C\u5229\u7528<strong>\u8FD0\u884C\u65F6\u53EF\u4EE5\u8BFB\u53D6\u5230\u7C7B\u5168\u90E8\u5C5E\u6027\u7684\u6280\u672F\uFF08\u4E5F\u5C31\u662F\u53CD\u5C04\uFF09</strong>\uFF0C\u5B9E\u73B0\u8BF8\u5982 Button\u3001TextArea\u3001Text \u7B49\u7B49\u53EF\u89C6\u5316\u7EC4\u4EF6\u7684\u5C01\u88C5\uFF0C\u4EE5\u4FBF\u8FDB\u884C\u7C7B\u4F3C\u4E8E\u67D0 Basic \u62D6\u62FD\u5F0F\u684C\u9762\u5E94\u7528\u5F00\u53D1\u3002\u800C\u6B64\u95F4\u7684 <code>\u7B26\u5408\u65E2\u5B9A\u89C4\u8303\u7684\u7C7B</code> \u4FBF\u662F Java Bean\uFF0C\u5B83\u9996\u5148\u662F\u4E00\u4E2A Java \u7C7B\uFF0C\u5176\u6B21\u9700\u8981\u6EE1\u8DB3\u4E00\u4E9B\u65E2\u5B9A\u89C4\u8303\uFF1A</p><ul><li>\u5177\u6709\u4E00\u4E2A\u65E0\u53C2\u6784\u9020\u51FD\u6570</li><li>\u6240\u6709\u5C5E\u6027\u90FD\u58F0\u660E\u4E3A <code>private</code>\uFF0C\u901A\u8FC7\u58F0\u660E\u4E3A <code>public</code> \u7684\u5F62\u5982 <code>getCertainAttr</code> \u7684 getter \u65B9\u6CD5\u83B7\u53D6\u5C5E\u6027\u3001\u5F62\u5982 <code>setCertainAttr</code> \u7684 setter \u65B9\u6CD5\u8BBE\u7F6E\u5C5E\u6027\u3002\u7279\u6B8A\u5730\uFF0C\u5E03\u5C14\u7C7B\u578B\u7684 getter \u65B9\u6CD5\u5F62\u5982 <code>isCertainAtrr</code>\u3002</li><li>\u53EF\u5E8F\u5217\u5316\uFF08\u7EE7\u627F\u81EA Serializable\uFF0C\u672C\u610F\u4E3A\u4E86\u4FDD\u5B58\u7EC4\u4EF6\u72B6\u6001\uFF0C\u4EE5\u4FBF\u8FD8\u539F\u72B6\u6001\uFF08\u6BD4\u5982\u4FDD\u5B58\u3001\u5173\u95ED\u540E\uFF0C\u518D\u6B21\u6253\u5F00\u9879\u76EE\uFF09\uFF0C\u7EE7\u7EED\u5F00\u53D1\uFF09</li></ul><p>\u5F53\u7136\uFF0C\u5728\u684C\u9762\u7EC4\u4EF6\u5316\u5F00\u53D1\u7684\u5E02\u573A\u4E0A\uFF0CJava \u4E0D\u662F\u5F88\u6210\u529F\uFF08\u4E3B\u8981\u662F Sun \u516C\u53F8\uFF09\uFF0C\u4F46 Java Bean \u662F\u65E0\u8F9C\u7684\uFF0C\u597D\u4E0D\u5BB9\u6613\u7F16\u7684\u4E00\u5957\u89C4\u8303\uFF0C\u4E5F\u8BB8\u53EF\u4EE5\u653E\u5728\u670D\u52A1\u7AEF\u5F00\u53D1\u4E0A\u3002\u4E8E\u662F Java Bean \u6210\u4E86 MVC \u4E2D\u7684 M\uFF0C\u4E3B\u8981\u7528\u4EE5\u4F20\u9012\u6570\u636E\u3001\u66F4\u65B9\u4FBF\u5730\u4E0E\u6301\u4E45\u5C42\u4E92\u52A8\u3002\u4F46\u7531\u4E8E Java Bean \u8FC7\u5206\u8F7B\u91CF\uFF0C\u4E0E\u6211 Sun \u5802\u5802 \u4F01\u4E1A\u7EA7\u5E94\u7528 \u683C\u683C\u4E0D\u5165\uFF08\u9700\u8981\u5F00\u53D1\u8005\u53BB\u53CD\u590D\u5730\u81EA\u884C\u5B9E\u73B0\u4E00\u4E9B\u7B80\u5355\u3001\u4F4E\u7EA7\u7684\u529F\u80FD\uFF09\uFF0C\u8FD9\u65E0\u7591\u589E\u52A0\u4E86\u9AD8\u8D35\u7684\u3001\u53EA\u60F3\u5173\u6CE8\u4E1A\u52A1\u903B\u8F91\u7684\u4F01\u4E1A\u7EA7\u5E94\u7528\u5F00\u53D1\u8005\u4EEC\u7684\u5FC3\u667A\u8D1F\u62C5\uFF0C\u4E8E\u662F\u57FA\u4E8E JB\uFF0C\u66F4\u52A0\u5468\u5230\u7684 EJB\uFF08Enterprise Java Bean\uFF09\u5E94\u8FD0\u800C\u751F\u3002</p><p>\u7136\u800C\uFF0C\u5468\u5230\u7684\u4EE3\u4EF7\u662F\u7E41\u7410\uFF0C\u5F88\u5FEB\uFF0CEJB \u5C31\u5931\u53BB\u4E86\u8D2A\u5A6A\u4F46\u61D2\u60F0\u7684\u4EBA\u4EEC\u7684\u5BA0\u7231\u3002\u66F4\u6709\u751A\u8005\uFF0C\u9AD8\u8C03\u5439\u6367 <code>Plain Old Java Object</code>\uFF08\u4E5F\u6709\u8A00\u66F0 <code>Plain Ordinary Java Object</code>\uFF0C\u610F\u8BD1\u8FC7\u6765\u5C31\u662F\uFF0C\u5E73\u6DE1\u65E0\u5947\u7684 Java \u5BF9\u8C61\uFF09\uFF0C\u60F3\u8981\u6765\u4E00\u573A Java \u5C4A\u7684\u4F1F\u5927\u7684\u6587\u827A\u590D\u5174\u3002\u6309\u7167\u4E1A\u754C\u5171\u8BC6\uFF0C\u4E00\u4E2A POJO \u65E0\u9700\u9075\u5FAA Java Bean \u7684\u4E0A\u53E4\u89C4\u8303\uFF0C\u7406\u5E94\u6DCB\u6F13\u5C3D\u81F4\u5730\u4F53\u73B0 <code>plain</code>\uFF1A</p><ul><li>\u5C5E\u6027\u58F0\u660E\u4E3A <code>private</code> \uFF0C\u901A\u8FC7 <code>public</code> \u7684 getter \u3001setter \u65B9\u6CD5\u83B7\u53D6\u3001\u8BBE\u7F6E\u5C5E\u6027</li><li>\u4E0D\u7EE7\u627F\u81EA\u4EFB\u4F55\u7C7B</li><li>\u4E0D\u5B9E\u73B0\u4EFB\u4F55\u63A5\u53E3</li><li>\u4E0D\u88AB\u4EFB\u4F55\u6846\u67B6\u4FB5\u5165</li></ul><p>\u7406\u60F3\u72B6\u6001\u4E0B\uFF0CPOJO \u7528\u4E8E\u6570\u636E\u4F20\u9012\uFF0C\u4EE5\u4FBF\u66F4\u81EA\u5982\u5730\u4E0E DAO \u5C42\uFF08\u4E5F\u5C31\u662F\u6301\u4E45\u5C42\uFF09\u4EA4\u4E92\u3002</p><p>\u540E\u6765\uFF0C\u4F5C\u4E3A\u9769\u547D\u7684\u4E00\u65B9\u91CC\u7A0B\u7891\uFF0C\u4E00\u4E2A\u53EB Spring \u7684\u6846\u67B6\u51FA\u751F\u4E86\u3002\u8BE5\u6846\u67B6\u901A\u8FC7\u81EA\u5E26\u7684 <code>Spring \u5BB9\u5668</code>\uFF0C\u5BF9\u5BF9\u8C61\u8FDB\u884C\u7BA1\u7406\uFF0C\u518D\u8F85\u52A9\u4EE5 IOC\u3001AOP \u6280\u672F\uFF0C\u65E2\u907F\u514D\u4E86\u7E41\u7410\uFF0C\u53C8\u4FDD\u969C\u4E86\u5B89\u5168\u3001\u51CF\u5C11\u4E86\u5FC3\u667A\u8D1F\u62C5\uFF08\u65E2\u53EF\u4EE5\u8D2A\uFF0C\u53C8\u53EF\u4EE5\u61D2\uFF09\u3002\u800C\u6B64\u95F4\u7684\u7C7B\uFF0C\u65E0\u9700\u89C4\u8303\uFF0C\u4E0D\u7BA1\u4F60 POJO \u4E0D POJO\u3001EJB \u4E0D EJB\uFF0C\u53EA\u8981\u80FD\u4E3A\u5BB9\u5668\u6240\u7BA1\u7406\u5373\u53EF\u3002\u540C\u65F6\uFF0C\u51FA\u4E8E\u7231\u4E0E\u656C\u610F\uFF0C\u6B64\u95F4\u7684\u7C7B\u4E5F\u88AB\u53EB\u505A Bean\uFF0C\u53C8\u4E3A\u4EBA\u5524\u4F5C <code>Spring Bean</code>\u3002</p><p>\u6B64\u5916\uFF0CJava \u4E16\u754C\u7684 Bean \u53D6\u5176 <code>\u5496\u5561\u8C46</code> \u4E4B\u610F\uFF0C\u5999\u54C9\u3002</p><h3 id="ioc" tabindex="-1">IOC <a class="header-anchor" href="#ioc" aria-hidden="true">#</a></h3><p>\u6240\u8C13 <code>IOC</code>\uFF0C\u5373 Inversion Of Control\uFF0C\u76F4\u8BD1\u4E3A<code>\u63A7\u5236\u53CD\u8F6C</code>\u3002\u6240\u8C13\u53CD\u8F6C\uFF0C\u53EF\u4EE5\u7406\u89E3\u4E3A \u8F6C\u53D8\u539F\u672C\u7684 A Call B\uFF0C\u4E3A A Wait For B\u3002\u539F\u672C A \u4E2D\u60F3\u8981\u4F7F\u7528 B \u4E2D\u7684\u529F\u80FD\uFF0C\u9700\u8981\u81EA\u884C\u5B9E\u4F8B\u5316 B\uFF0C\u8FD9\u6837\u7684\u7F3A\u70B9\u5728\u4E8E\uFF0C\u4E00\u65E6 B \u6709\u6240\u6539\u53D8\uFF08\u65B9\u6CD5\u7B49\u8C03\u7528\u65B9\u5F0F\u6709\u6240\u53D8\u66F4\uFF09\uFF0C\u8FEB\u4F7F A \u4E5F\u8981\u4FEE\u6539\u3002\u800C\u6709\u4E86 IOC\uFF0C\u7C7B\u4E0E\u7C7B\u95F4\u7684\u4F9D\u8D56\u7EDF\u4E00\u4EA4\u7531\u5BB9\u5668\u8FDB\u884C\u7BA1\u7406\uFF0C\u7C7B\u4E0E\u7C7B\u95F4\u89E3\u8026\uFF0C\u6545\u53C8\u88AB\u53EB\u4F5C <code>\u4F9D\u8D56\u6CE8\u5165</code>\u3002</p><h3 id="aop" tabindex="-1">AOP <a class="header-anchor" href="#aop" aria-hidden="true">#</a></h3><p>\u6240\u8C13\uFF0CAOP \u5373 Aspect Oriented Programming\uFF0C\u76F4\u8BD1\u4E3A <code>\u9762\u5411\u5207\u9762\u7F16\u7A0B</code>\u3002\u6B64\u524D\uFF0C\u5BF9\u4E8E\u4E00\u4E9B\u91CD\u590D\u7684 \u65E5\u5FD7\u8BB0\u5F55\u3001\u4E8B\u52A1\u4E66\u5199 \u7684\u8FC7\u7A0B\uFF0C\u5F00\u53D1\u8005\u4EEC\u9700\u8981\u4E00\u904D\u4E00\u904D\u5730\u590D\u5236\u7C98\u8D34\u3002\u6B64\u540E\uFF0C\u901A\u8FC7\u52A8\u6001\u4EE3\u7406\u6280\u672F\uFF0C\u8FD9\u4E9B\u8FC7\u7A0B\u5B9B\u5982\u7ACB\u8EAB\u4E8E\u4E00\u4E2A\u5207\u9762\uFF0C\u4E0D\u5728\u4E09\u754C\u4E4B\u4E2D\uFF0C\u72EC\u5584\u4E94\u884C\u4E4B\u5916\u3002</p><h2 id="\u5173\u4E8E-spring-boot" tabindex="-1">\u5173\u4E8E Spring Boot <a class="header-anchor" href="#\u5173\u4E8E-spring-boot" aria-hidden="true">#</a></h2><h3 id="\u6982\u89C8" tabindex="-1">\u6982\u89C8 <a class="header-anchor" href="#\u6982\u89C8" aria-hidden="true">#</a></h3><p>\u4F7F\u7528\u5927\u4E8E\u516D\u7EA7\u7684\u6C34\u5E73\uFF0C\u610F\u8BD1\u5B98\u7F51\u7684 overview \u4E2D\u5173\u4E8E SB \u7684\u4ECB\u7ECD\u4E3A\uFF1A</p><blockquote><p>SB \u4F7F\u5F97\u521B\u5EFA \u53EF\u72EC\u7ACB\u8FD0\u884C\u3001\u751F\u4EA7\u7EA7\u3001\u57FA\u4E8E Spring \u6846\u67B6\u7684\u5E94\u7528 \u53D8\u5F97<s>\u5DE8\u51E0\u628A</s>\u7B80\u5355\uFF0C\u4F60\u6240\u8981\u505A\u7684\uFF0C\u4EC5\u4EC5\u662F\u8FD0\u884C\u5E94\u7528\u800C\u5DF2\u3002</p><p>\u7B80\u800C\u8A00\u4E4B\uFF0C\u6211\u4EEC\u4ECE \u51CF\u5C11\u5FC3\u667A\u8D1F\u62C5 \u51FA\u53D1\uFF0C\u6574\u5408\u4E86 Spring \u6846\u67B6\u4E0E\u4E00\u4E9B\u4E09\u65B9\u5E93\uFF0C\u4EE5\u4FBF\u4F60\u53EF\u4EE5\u4EE5\u6700\u5C11\u7684\u914D\u7F6E\u8FDB\u884C Spring \u5E94\u7528\u5F00\u53D1\u3002</p></blockquote><p>\u603B\u4E4B\uFF0C\u4E3B\u5F20\u201C\u7EA6\u5B9A\u4F18\u4E8E\u914D\u7F6E\u201D\u7684 Spring Boot\uFF0C\u4F7F Spring \u5F00\u53D1\u65E0\u6BD4\u7B80\u6D01\u3001\u6781\u5176\u5FEB\u901F\u3002</p><h3 id="\u7279\u6027" tabindex="-1">\u7279\u6027 <a class="header-anchor" href="#\u7279\u6027" aria-hidden="true">#</a></h3><ul><li>\u521B\u5EFA\u53EF\u72EC\u7ACB\u8FD0\u884C\u7684 Spring \u5E94\u7528</li><li>\u5185\u7F6E Tomcat\u3001Jetty \u6216 Undertow\uFF0C\u65E0\u9700\u90E8\u7F72 WAR \u6587\u4EF6</li><li>\u63D0\u4F9B\u89E3\u653E\u53CC\u624B\u3001\u7B80\u5316\u6784\u5EFA\u914D\u7F6E\u7684 <code>starter</code></li><li>\u81EA\u52A8\u3001\u5373\u65F6\u5730\u914D\u7F6E Spring \u6846\u67B6\u3001\u4E09\u65B9\u5E93</li><li>\u63D0\u4F9B \u51C6\u751F\u4EA7 \u7684\u7279\u6027\uFF0C\u4F60\u6BD4\u5982\u5EA6\u91CF\u6307\u6807\u3001\u5065\u5EB7\u68C0\u67E5\u3001\u52A0\u8F7D\u914D\u7F6E\u4FE1\u606F</li><li>\u7EDD\u65E0\u4EE3\u7801\u751F\u6210\uFF0C\u7EDD\u4E0D\u9700 xml \u914D\u7F6E</li></ul><h3 id="\u53C2\u8003" tabindex="-1">\u53C2\u8003 <a class="header-anchor" href="#\u53C2\u8003" aria-hidden="true">#</a></h3><ul><li><a href="https://mp.weixin.qq.com/s?__biz=MzAxOTc0NzExNg==&amp;mid=2665513115&amp;idx=1&amp;sn=da30cf3d3f163d478748fcdf721b6414#rd" target="_blank" rel="noreferrer">Java \u5E1D\u56FD\u4E4B Java bean (\u4E0A\uFF09</a></li><li><a href="https://mp.weixin.qq.com/s?__biz=MzAxOTc0NzExNg==&amp;mid=2665513118&amp;idx=1&amp;sn=487fefb8fa7efd59de6f37043eb21799#rd" target="_blank" rel="noreferrer">Java \u5E1D\u56FD\u4E4B Java bean\uFF08\u4E0B\uFF09</a></li></ul>',29),o=[t];function l(d,p,c,s,h,g){return i(),a("div",null,o)}const B=e(n,[["render",l]]);export{u as __pageData,B as default};
